import React from "react";

const MenuCard = ({ menuData }) => {
  console.log(menuData);
  return (
    <>
    <section className="main-card--cointainer ">

      {menuData.map((curElem) => {
        return (
          <>
            <div className="card-container" key={curr}>
              <div className="card">
                <div className="card-body">
                  <span className="card-number card-circle subtle">1</span>
                  <span className="card-author subtle">Breakfast</span>
                  <h2 className="card-title">Maggi</h2>
                  <span className="card-description subtle">
                    Lorem ipsum dolor sit amet consectetur adipisicing elit.
                    Nostrum blanditiis, odit aut fuga numquam ad doloribus? Quod
                    dolore magni veniam perferendis dolor, ipsum illum?
                    Blanditiis ex voluptas doloribus culpa labore obcaecati
                    velit deleniti consectetur.
                  </span>
                  <div className="card-read">Read</div>
                  <div>
                    {/* <img src={image} alt="images" className="card-media" /> */}
                    <span className="card-tag subtle">Order Now</span>
                  </div>
                </div>
              </div>
            </div>
          </>
        );
      })}
    </section>
    </>
  );
};

export default MenuCard;
